import React from 'react';
// import { Paper } from '@mui/material';
import { TextField } from '@mui/material';
import { Paper } from '@mui/material';
import { appendErrors, useForm } from 'react-hook-form';

export default function InputField(props) {
  return (
    <TextField
      id="outlined-basic"
      variant="outlined"
      autoComplete="email"
      autoFocus
      style={{
        margin: 0,
        textAllign: 'centre',
        width: 'inherit',
        fontFamily: 'Montserrat',
      }}
      label={props.field}
    />
  );
}
